<node CREATED="1428651545828" ID="ID_449142193" MODIFIED="1476758715204" TEXT="windows+cygwin">
<node CREATED="1428651553528" ID="ID_1121264872" MODIFIED="1428651559191" TEXT="/usr/bin/sbt">
<node CREATED="1428651564563" ID="ID_1846300070" MODIFIED="1428651571211">
<richcontent TYPE="NODE"><html>
  <head>
    
  </head>
  <body>
    <p>
      #!/usr/bin/bash
    </p>
    <p>
      SBT_OPTS="-Xms512M -Xmx1536M -Xss1M -XX:+CMSClassUnloadingEnabled -XX:MaxPermSize=256M"
    </p>
    <p>
      java $SBT_OPTS -jar `cygpath -m /usr/share/sbt/bin/sbt-launch.jar` "$@"
    </p>
  </body>
</html></richcontent>
</node>
</node>
