      Whenever a setting uses<span class="Apple-converted-space">&#xa0;</span><font size="1em" face="Consolas, Liberation Mono, Courier, monospace"><code style="font-family: Consolas, Liberation Mono, Courier, monospace; padding-right: 0px; border-top-width: 0px; margin-right: 0px; border-bottom-style: none; margin-bottom: 0px; font-variant: normal; border-left-color: border-color; margin-left: 0px; border-left-style: none; border-right-color: border-color; border-top-color: border-color; border-bottom-width: 0px; font-style: normal; border-right-style: none; margin-top: 0px; vertical-align: baseline; padding-bottom: 0px; padding-left: 0px; border-top-style: none; font-weight: normal; border-right-width: 0px; padding-top: 0px; border-bottom-color: border-color; border-left-width: 0px; font-size: 1em; line-height: 1.5">:=</code></font>,<span class="Apple-converted-space">&#xa0;</span><font size="1em" face="Consolas, Liberation Mono, Courier, monospace"><code style="font-family: Consolas, Liberation Mono, Courier, monospace; padding-right: 0px; border-top-width: 0px; margin-right: 0px; border-bottom-style: none; margin-bottom: 0px; font-variant: normal; border-left-color: border-color; margin-left: 0px; border-left-style: none; border-right-color: border-color; border-top-color: border-color; border-bottom-width: 0px; font-style: normal; border-right-style: none; margin-top: 0px; vertical-align: baseline; padding-bottom: 0px; padding-left: 0px; border-top-style: none; font-weight: normal; border-right-width: 0px; padding-top: 0px; border-bottom-color: border-color; border-left-width: 0px; font-size: 1em; line-height: 1.5">+=</code></font>, or<span class="Apple-converted-space">&#xa0;</span><font size="1em" face="Consolas, Liberation Mono, Courier, monospace"><code style="font-family: Consolas, Liberation Mono, Courier, monospace; padding-right: 0px; border-top-width: 0px; margin-right: 0px; border-bottom-style: none; margin-bottom: 0px; font-variant: normal; border-left-color: border-color; margin-left: 0px; border-left-style: none; border-right-color: border-color; border-top-color: border-color; border-bottom-width: 0px; font-style: normal; border-right-style: none; margin-top: 0px; vertical-align: baseline; padding-bottom: 0px; padding-left: 0px; border-top-style: none; font-weight: normal; border-right-width: 0px; padding-top: 0px; border-bottom-color: border-color; border-left-width: 0px; font-size: 1em; line-height: 1.5">++=</code></font><span class="Apple-converted-space">&#xa0;</span>to create a dependency on itself or another key&#x2019;s value, the value it depends on must exist. If it does not, sbt will complain. It might say<span class="Apple-converted-space">&#xa0;</span><font size="inherit" face="inherit"><em style="font-family: inherit; padding-right: 0px; border-top-width: 0px; margin-right: 0px; border-bottom-style: none; margin-bottom: 0px; font-variant: inherit; border-left-color: border-color; margin-left: 0px; border-left-style: none; border-right-color: border-color; border-top-color: border-color; border-bottom-width: 0px; font-style: italic; border-right-style: none; margin-top: 0px; vertical-align: baseline; padding-bottom: 0px; padding-left: 0px; border-top-style: none; font-weight: normal; border-right-width: 0px; padding-top: 0px; border-bottom-color: border-color; border-left-width: 0px; font-size: inherit; line-height: inherit"><i>&#x201c;Reference to undefined setting&#x201c;</i></em></font>, for example. When this happens, be sure you&#x2019;re using the key in the<span class="Apple-converted-space">&#xa0;</span><font size="inherit" face="inherit" color="rgb(25, 170, 207)"><u><a style="font-family: inherit; padding-right: 0px; border-top-width: 0px; margin-right: 0px; border-bottom-style: none; margin-bottom: 0px; font-variant: inherit; border-left-color: border-color; color: rgb(25, 170, 207); margin-left: 0px; border-left-style: none; border-right-color: border-color; border-top-color: border-color; border-bottom-width: 0px; font-style: inherit; border-right-style: none; margin-top: 0px; vertical-align: baseline; padding-bottom: 0px; padding-left: 0px; border-top-style: none; font-weight: normal; border-right-width: 0px; padding-top: 0px; border-bottom-color: border-color; border-left-width: 0px; font-size: inherit; line-height: inherit; text-decoration: underline" href="http://www.scala-sbt.org/0.13/tutorial/Scopes.html">scope</a></u></font><span class="Apple-converted-space">&#xa0;</span>that defines it.
    </p>
    <p style="font-family: Source Sans Pro, Helvetica Neue, Arial, sans-serif; border-top-width: 0px; padding-right: 0px; white-space: normal; margin-right: 0px; border-bottom-style: none; text-align: start; font-variant: normal; margin-bottom: 0; text-transform: none; color: rgb(0, 0, 0); border-left-color: border-color; margin-left: 0px; border-left-style: none; border-right-color: border-color; border-top-color: border-color; border-bottom-width: 0px; letter-spacing: normal; font-style: normal; border-right-style: none; margin-top: 0; vertical-align: baseline; padding-bottom: 0px; word-spacing: 0px; padding-left: 0px; border-top-style: none; font-weight: normal; border-right-width: 0px; padding-top: 0px; border-bottom-color: border-color; text-indent: 0; border-left-width: 0px; font-size: 16.0016002655029px; line-height: 16.0016002655029px">
      It&#x2019;s possible to create cycles, which is an error; sbt will tell you if you do this.
    </p>
  </body>
