      </li>
      <li style="padding-top: 0px; letter-spacing: normal; background-color: rgb(255, 255, 255); vertical-align: baseline; border-bottom-color: border-color; text-indent: 0px; border-left-width: 0px; margin-right: 0px; border-top-width: 0px; margin-bottom: 0px; padding-bottom: 0px; padding-left: 0px; word-spacing: 0px; border-bottom-style: none; font-style: normal; margin-top: 0px; font-weight: normal; padding-right: 0px; border-right-width: 0px; border-bottom-width: 0px; font-family: Source Sans Pro, Helvetica Neue, Arial, sans-serif; border-top-style: none; border-right-style: none; color: rgb(0, 0, 0); text-transform: none; font-variant: normal; margin-left: 0px; border-left-color: border-color; line-height: 16.0016002655029px; font-size: 16.0016002655029px; border-top-color: border-color; border-left-style: none; white-space: normal; border-right-color: border-color">
        the<span class="Apple-converted-space">&#xa0;</span><font face="Consolas, Liberation Mono, Courier, monospace" size="1em"><code style="padding-top: 0px; border-bottom-color: border-color; vertical-align: baseline; border-left-width: 0px; border-top-width: 0px; margin-right: 0px; padding-bottom: 0px; margin-bottom: 0px; padding-left: 0px; border-bottom-style: none; font-style: normal; padding-right: 0px; margin-top: 0px; font-weight: normal; border-right-width: 0px; border-bottom-width: 0px; font-family: Consolas, Liberation Mono, Courier, monospace; border-top-style: none; border-right-style: none; font-variant: normal; margin-left: 0px; border-left-color: border-color; line-height: 1.5; font-size: 1em; border-top-color: border-color; border-left-style: none; border-right-color: border-color">packageOptions</code></font><span class="Apple-converted-space">&#xa0;</span>key (which contains options for creating jar packages) may have different values when packaging class files (<font face="Consolas, Liberation Mono, Courier, monospace" size="1em"><code style="padding-top: 0px; border-bottom-color: border-color; vertical-align: baseline; border-left-width: 0px; border-top-width: 0px; margin-right: 0px; padding-bottom: 0px; margin-bottom: 0px; padding-left: 0px; border-bottom-style: none; font-style: normal; padding-right: 0px; margin-top: 0px; font-weight: normal; border-right-width: 0px; border-bottom-width: 0px; font-family: Consolas, Liberation Mono, Courier, monospace; border-top-style: none; border-right-style: none; font-variant: normal; margin-left: 0px; border-left-color: border-color; line-height: 1.5; font-size: 1em; border-top-color: border-color; border-left-style: none; border-right-color: border-color">packageBin</code></font>) or packaging source code (<font face="Consolas, Liberation Mono, Courier, monospace" size="1em"><code style="padding-top: 0px; border-bottom-color: border-color; vertical-align: baseline; border-left-width: 0px; border-top-width: 0px; margin-right: 0px; padding-bottom: 0px; margin-bottom: 0px; padding-left: 0px; border-bottom-style: none; font-style: normal; padding-right: 0px; margin-top: 0px; font-weight: normal; border-right-width: 0px; border-bottom-width: 0px; font-family: Consolas, Liberation Mono, Courier, monospace; border-top-style: none; border-right-style: none; font-variant: normal; margin-left: 0px; border-left-color: border-color; line-height: 1.5; font-size: 1em; border-top-color: border-color; border-left-style: none; border-right-color: border-color">packageSrc</code></font>).
