<richcontent TYPE="NODE"><html>
  <head>
    
  </head>
  <body>
    <p style="padding-top: 0px; letter-spacing: normal; vertical-align: baseline; border-bottom-color: border-color; text-indent: 0px; border-left-width: 0px; margin-right: 0px; border-top-width: 0px; margin-bottom: 0; padding-bottom: 0px; padding-left: 0px; word-spacing: 0px; border-bottom-style: none; font-style: normal; margin-top: 0px; font-weight: normal; padding-right: 0px; border-right-width: 0px; border-bottom-width: 0px; font-family: Source Sans Pro, Helvetica Neue, Arial, sans-serif; border-right-style: none; border-top-style: none; color: rgb(0, 0, 0); text-transform: none; font-variant: normal; margin-left: 0px; border-left-color: border-color; line-height: 16.0016002655029px; font-size: 16.0016002655029px; border-top-color: border-color; text-align: start; border-left-style: none; white-space: normal; border-right-color: border-color">
      If you<span class="Apple-converted-space">&#xa0;</span><font face="inherit" color="rgb(25, 170, 207)" size="inherit"><u><a style="padding-top: 0px; border-bottom-color: border-color; vertical-align: baseline; border-left-width: 0px; border-top-width: 0px; margin-right: 0px; padding-bottom: 0px; margin-bottom: 0px; padding-left: 0px; text-decoration: underline; border-bottom-style: none; font-style: inherit; padding-right: 0px; margin-top: 0px; font-weight: normal; border-right-width: 0px; border-bottom-width: 0px; font-family: inherit; border-top-style: none; border-right-style: none; color: rgb(25, 170, 207); font-variant: inherit; margin-left: 0px; border-left-color: border-color; line-height: inherit; font-size: inherit; border-top-color: border-color; border-left-style: none; border-right-color: border-color" href="http://www.scala-sbt.org/0.13/tutorial/Multi-Project.html">put multiple projects in a single build</a></u></font>, each project needs its own settings. That is, keys can be scoped according to the project.
    </p>
    <p style="padding-top: 0px; letter-spacing: normal; vertical-align: baseline; border-bottom-color: border-color; text-indent: 0; border-left-width: 0px; margin-right: 0px; border-top-width: 0px; margin-bottom: 0; padding-bottom: 0px; padding-left: 0px; word-spacing: 0px; border-bottom-style: none; font-style: normal; margin-top: 0; font-weight: normal; padding-right: 0px; border-right-width: 0px; border-bottom-width: 0px; font-family: Source Sans Pro, Helvetica Neue, Arial, sans-serif; border-right-style: none; border-top-style: none; color: rgb(0, 0, 0); text-transform: none; font-variant: normal; margin-left: 0px; border-left-color: border-color; line-height: 16.0016002655029px; font-size: 16.0016002655029px; border-top-color: border-color; text-align: start; border-left-style: none; white-space: normal; border-right-color: border-color">
      The project axis can also be set to &#x201c;entire build&#x201d;, so a setting applies to the entire build rather than a single project. Build-level settings are often used as a fallback when a project doesn&#x2019;t define a project-specific setting.
    </p>
  </body>
</html></richcontent>
